import { Component } from '@angular/core';

@Component({
  selector: 'app-ipd',
  templateUrl: './ipd.component.html',
  styleUrls: ['./ipd.component.css']
})
export class IPDComponent {

}
<mat-grid-list cols="4" rowHeight="2:1" gutterSize="40px">
    <mat-grid-tile>IPD Registration </mat-grid-tile>
    <mat-grid-tile>Advance</mat-grid-tile>
    <mat-grid-tile>Shift</mat-grid-tile>
    <mat-grid-tile>Document Upload</mat-grid-tile>
    <mat-grid-tile>5</mat-grid-tile>
    <mat-grid-tile>6</mat-grid-tile>
    <mat-grid-tile>7</mat-grid-tile>
    <mat-grid-tile>8</mat-grid-tile>

  </mat-grid-list>
